import React from 'react';

import './LoginBox.css';
import Paper from '@material-ui/core/Paper';
import Avatar from '@material-ui/core/Avatar';
import LockOutlinedIcon from '@material-ui/icons'

const LoginBox = () => {
    return(
        <Paper >
            <Avatar>
                <LockOutlinedIcon />
            </Avatar>
        </Paper>
    );
};

export default LoginBox;
